// App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { AuthProvider } from "./AuthContext"; // Adjust the path as necessary
import Sidebar from "../src/components/admin/inc/siderbar";
import FormLogin from "./components/FormLogin"; // Adjust the path as necessary
import Dashboard from "./components/admin/Dashboard"; // Adjust the path as necessary
// Import other components as needed

const App = () => {
  return (
    <AuthProvider>
      <Router>
        <Sidebar />
        <Routes>
          <Route path="/login" element={<FormLogin />} />
          <Route path="/dashboard" element={<Dashboard />} />
          {/* Add other routes as necessary */}
        </Routes>
      </Router>
    </AuthProvider>
  );
};

export default App;
